import {Link} from 'react-router-dom'
function Productos(props) {
  return (
    <div className="App">
      <div>{props.productos.name}</div>
      <div>{props.productos.price}</div>
      <Link to={"/productos/"+props.productos.id}><button>Ver</button></Link>
    </div>
  );
}

export default Productos;
